import ap1 from "../img/aurora/ap1.png";
import ap2 from "../img/aurora/ap2.png";
import ap4 from "../img/aurora/ap4.png";

const imagesAurora = [{
    id: 1,
    src: ap1,
    alt: "Image 1"
},
{
    id: 2,
    src: ap2,
    alt: "Image 2 "
},
{
    id: 3,
    src: "src/img/aurora/ap4.png",
    alt: "Image 3"
}
];
export default imagesAurora;
